import './App.css';
import Header from './components/Header';
import Navbar from './components/Navbar';
import data from './assets/data';


function App() {
  {data.map((slide, index) => (
    <Header
      key={index}
      image={slide.image}
      title={slide.title}
      subtitle={slide.subtitle}
      isWhite={slide.isWhite}
    />
  ))}
  return (
    <>
    <Navbar />
    {Header}
    </>
  );
}

export default App;
